import * as React from 'react';
import './home_ebook.css';
import Ebook from '../img/home_ebook.png'

export class HomeEbook extends React.Component {
    render() {
        return (
            <div className="container-fluid">
                <img src={Ebook} alt="ebook do NEU" />
                <h2>Guia para os futuros empreendedores</h2>
                <p>Se interessa por empreendedorismo e não sabe por onde começar? Esse e-book foi preparado pelo NEU para ajudar você a dar os primeiros passos no seu negócio.</p>
                <button type="button col-lg-6 col-md-6 col-sm-8 col-xs-2" className="button-primary-yellow" href="#">Baixar guia</button>
            </div>
        )
    }
}
